import React from 'react';
import PropTypes from 'prop-types';

function DropZone(props) {
    const content = props.children;
 
    return (
      <div className={props.tag} >
        {content}
      </div>
    );
}

DropZone.propTypes = {
  tag: PropTypes.string.isRequired
}

export default DropZone;
